import React from "react";
import PlayerScore from "./PlayerScore";

const HighScoreTable = ({ country }) => {
    return (
        <>

            <h2>High scores: {country.name}</h2>
            <table>
                <tr>
                    <th>Name</th>
                    <th>Score</th>
                </tr>
                {country.scores.map((score, index) => {
                    (
                        <tr key={index}>
                            <td>{score.n}</td>
                            <td>{score.s}</td>
                        </tr>
                    )
                })}
            </table>
        </>
    )
}

export default HighScoreTable;
